CREATE DEFINER=`root`@`localhost` FUNCTION `actulizar_recintos_de_juntas_femeninas`() RETURNS tinyint(1)
BEGIN
   
    DECLARE xidjunta,xfr_id_zona,x_num_junta integer;
    DECLARE xgenero CHAR(16);
    DECLARE done INT DEFAULT 0;

    DECLARE cur1 CURSOR FOR SELECT idjunta,fr_id_zona,num_junta,genero from junta
    where genero = 'F';

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur1;

    REPEAT
    FETCH cur1 INTO xidjunta,xfr_id_zona,x_num_junta,xgenero;
        IF NOT done THEN
            update junta set cod_recinto=(select cod_recinto from recintos
            where cod_zona=xfr_id_zona 
            and x_num_junta between jun_ini_f and jun_fin_f)
            where idjunta=xidjunta;
        END IF;
    UNTIL done END REPEAT;
    CLOSE cur1;
    RETURN true;
END ;;
