CREATE DEFINER=`root`@`localhost` FUNCTION `crear_juntas_x_recnitos`() RETURNS tinyint(1)
BEGIN
    DECLARE id integer; /*cod recinto*/
    DECLARE idzona integer; /*cod recinto*/
    DECLARE ini integer;
    DECLARE fin integer;
    DECLARE done INT DEFAULT 0;
    DECLARE cur1 CURSOR FOR SELECT cod_recinto,cod_zona FROM recintos;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    OPEN cur1;
    REPEAT
    FETCH cur1 INTO id,idzona;
        IF NOT done THEN
            /*MUJERES*/
            SET ini=0;
            SET fin=0;
            select jun_ini_f from recintos where cod_recinto=id into ini;
            select jun_fin_f from recintos where cod_recinto=id into fin;
            WHILE ini <= fin DO
                insert into junta (fr_id_zona,num_junta,genero,cod_recinto) values (idzona,ini,'F',id);
                SET ini=ini +1;
            END WHILE;
            /*HOMBRES*/
            SET ini=0;
            SET fin=0;
            select jun_ini_m from recintos where cod_recinto=id into ini;
            select jun_fin_m from recintos where cod_recinto=id into fin;
            WHILE ini <= fin DO
                insert into junta (fr_id_zona,num_junta,genero,cod_recinto) values (idzona,ini,'M',id);
                SET ini=ini +1;
            END WHILE;
        END IF;
    UNTIL done END REPEAT;
    CLOSE cur1;
    RETURN true;
END ;;
