    DECLARE cur1 CURSOR FOR SELECT idzonas FROM zonas;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    OPEN cur1;
    REPEAT
    FETCH cur1 INTO id;
        IF NOT done THEN
            /*MUJERES*/
            SET ini=0;
            SET fin=0;
            select num_junta_mujeres_ini from zonas where idzonas=id into ini;
            select num_junta_mujeres_fin from zonas where idzonas=id into fin;
            WHILE ini <= fin DO
                insert into junta (fr_id_zona,num_junta,genero) values (id,ini,'F');
                SET ini=ini +1;
            END WHILE;
            /*HOMBRES*/
            SET ini=0;
            SET fin=0;
            select num_junta_hombre_ini from zonas where idzonas=id into ini;
            select num_junta_hombre_fin from zonas where idzonas=id into fin;
            WHILE ini <= fin DO
                insert into junta (fr_id_zona,num_junta,genero) values (id,ini,'M');
                SET ini=ini +1;
            END WHILE;
        END IF;
    UNTIL done END REPEAT;
    CLOSE cur1;
    RETURN true;
END ;;
